import React from 'react';
import axios from 'axios';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';


export default class ReportList extends React.Component {
  state = {
    reports: []
  }

  componentDidMount() {
    const headers = {
        "Content-Type": "application/json",
      };

      const url = "http://localhost:8000/report";
      axios.get(url, { headers })
      .then(res => {
        const reports = res.data;
        this.setState({ reports });
      })
  }

  render() {
    return (
      <ul>
        {
                <TableContainer component={Paper}>
                <Table sx={{ minWidth: 10 }} aria-label="simple table">
                  <TableHead>
                    <TableRow>
                      <TableCell>ID</TableCell>
                      <TableCell align="right">Assessment date</TableCell>
                      <TableCell align="right">Name</TableCell>
                      <TableCell align="right">Overall verdict</TableCell>
                    </TableRow>
                  </TableHead>
                  <TableBody>
                    {this.state.reports
            .map((report) => (
                      <TableRow
                        key={report.name}
                        sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
                      >
                        <TableCell component="th" scope="row">
                          {report.id}
                        </TableCell>
                        <TableCell align="right">{report.assessment_date}</TableCell>
                        <TableCell align="right">{report.name}</TableCell>
                        <TableCell align="right">{report.overall_verdict}</TableCell>
                      </TableRow>
                    ))}
                  </TableBody>
                </Table>
              </TableContainer>

        }
      </ul>
    )
  }
}
